(2,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'0','1',NULL,NULL,2,2,2,NULL,'US','Guizhou Province Architectural Design & Research Institute, Nanming, , , /','','YunYan','Guizhou','551400','26.8429645','107.2902839',1,'Asia/Shanghai','2019-03-27 09:50:28','2021-11-24 05:52:19','Classic Harlem Brownstone - NYC',' Your Master Bedroom is located on the top floor of a classic Harlem brownstone, with a full guests-shared kitchen and bath. The home is located on Sugar Hill and is across the street from St. Nicholas Park and Hamilton Grange.\n\nThe Master Bedroom is on the top floor of a classic Harlem brownstone, build in 1901. It is gorgeous and spacious, facing the front of the house. You will have soft light in the morning, and a wonderful view of the city lights at night.\n\nPop out to the balcony or across the street to the park for some fresh air! Hamilton Heights, where the home is located, is a fun neighborhood with great fine dining, brunch and tasty takeout! You will have plenty of options for restaurants, bars, music venues and historical landmarks to visit during your stay.\n\nOnce home, enjoy the peace and quite of Hamilton Terrace. This beautiful and historic block is a quaint residential enclave you\'ll love at first sight!\n\nGuest access\n\nGuest have complete access to the full kitchen and full bath.',45,'instant',1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'59ff51dccdd5641187c2748fd2998af9','2021-11-24 05:52:19','https://www.airbnb.de/rooms/34928560/reviews','Stays',NULL),
(3,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'0','3',NULL,NULL,3,5,2.5,NULL,'GB','76 Russell Rd, ',NULL,'Nottingham','UK','NG1 5AW','52.9550908','-1.1583049',1,'Europe/London','2019-03-27 09:54:02','2021-06-03 06:42:22','Immaculate Lakefront Condo w/boat slip-THIS IS IT!','Whether you need a romantic getaway for two, a family fun week at the lake, or a fisherman\'s weekend, Smith Mountain Lake & our penthouse condo has it all just steps from the water. From sitting on the deck watching the sunset over the water while enjoying your favorite beverage, to drifting off to sleep cuddled up in our crisp linens after a day on the lake - Come for a visit - fall in love for a lifetime!',55,'request',1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'2021-06-03 05:36:20','https://www.airbnb.com/rooms/48523518/reviews','Stays',NULL),
(4,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'1','4',NULL,NULL,4,4,4,NULL,'US','328 East Fir Avenue, ',NULL,'Atwater','CA','90001','37.3456814','-120.5913511',1,'America/Los_Angeles','2019-03-27 09:56:36','2020-08-18 12:50:18','Adorable townhouse near MFL train & hipster spots','Relax in this adorable and cozy little Philly row house in the calm end of Fishtown. Steps from great coffee, cute independent shops and galleries, a stones throw from more hipster amenities, food and nightlife throughout Fishtown and Northern Liberties. And just a quick ride away from Old City, Center City or the airport.\n\nFull kitchen - Laundry - Patio - Free unlimited street parking all around and easy loading area right out front',38,'request',1,NULL,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'Stays','1'),
(5,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,NULL,'3',NULL,NULL,3,3,3,NULL,'GB','Basse Normandie, Rue Verte, ',NULL,'Hrouville-Saint-Clair','France','75116','49.205084','-0.318614',1,'Europe/Paris','2019-03-27 10:03:30','2023-02-21 05:09:08','Historic Georgian Lakeside Mansion 500 acre Park','This 250 year old delightful and spacious Georgian Menagerie - a replica of that built for Marie Antoinette at Palace of Versailles - is set within 10 acres of private grounds in a 500 acre country park. Sleep in a four poster bed, handmade from oak gifted to the owners by Prince Charles; one of 5 bedrooms available (with a further 2 by separate negotiation)',33,'request',1,NULL,1,5,'Vegan','No',NULL,NULL,'Just a short test\n\nabout this and that\nor everything\n\n\n\nHow does it look like?',NULL,NULL,NULL,0,'13e2a885f384bb749284dbb1d1a9806c','2021-06-03 07:24:00','https://www.airbnb.com/rooms/34200604/reviews','Stays','8'),
