(967,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Absolute Empfehlung! Die Wohnung war super sauber und gut gepflegt, die Kche war toll ausgestattet, der Blick auf den Gipfel war wunderschn. Gemtlich, man kann toll entspannen, die Lage ist perfekt, man kann super parken und ziemlich alles fulufig in guter Zeit erreichen. Wir sind absolut zufrieden und dankbar GP in dieser Unterkunft erleben zu drfen! Die Gastgeber sind auch freundlich und nett und stellen immer sicher, dass man alles hat, was man braucht, sind gut erreichbar und haben immer ein Lcheln parat. Gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Mirela','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),
(968,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','saubere Unterkunft, toller Ausblick vom Balkon. Sehr empfehlenswert!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Patrick','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),
