(970,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist wie beschrieben.Sie ist sehr sauber und enthlt alles was man bentigt. Klein aber fein. Die Aussicht auf die Olympiaschanze vom Balkon ist toll. Wir haben uns sehr sehr wohl gefhlt. Die Gastgeber haben uns sehr herzlich empfangen und es lief alles ohne Probleme. Ich kann es nur weiterempfehlen',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Nadine','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),
(971,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Positiv: Tolles Einrichtung Super Lage & Aussicht Ruhig Sehr sauber Negativ: Deckenhhe/ Trrahmen fr groe Menschen schwierig Details fehlten wie Pfeffer, Seife. Sehr wenig Kchen Utensilien',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Sren','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),
(972,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war alles zu unserer Zufriedenheit. Ruhige und schne Lage mit direktem Blick vom Balkon auf die Skisprungschanze und aus den Fenstern in Richtung Zugspitze. Kommunikation, Schlsselbergabe, usw. haben wunderbar funktioniert. Wir kommen gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Christian','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),
(973,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nachdem wir die Check In Zeit um ca. 20min nicht geschafft htten, wurden wir darauf hingewiesen, da nach 20Uhr keine Anreise (laut Richtlinien) mehr mglich ist, welches mir Telefonisch vom Verwalter besttigt wurde!! Deswegen gab es keinen Aufenthalt in der Ferienwohnung!!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Sigmund','https://www.airbnb.de/rooms/31289582/reviews','Mai 2019'),
(974,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Unser Aufenthalt in der Kleinen Auszeit war perfekt. Kontakt, Schlsselbergabe, alles perfekt! Die Wohnung ist absolut gemtlich, wir haben uns sofort wie zu Hause gefhlt. Die Lage ist top, toller Blick vom Balkon auf die Berge und die Sprungschanze. Wir kommen gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Andrea','https://www.airbnb.de/rooms/31289582/reviews','April 2019'),
(975,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Klasse kleine Wohnung zum Wohfhlen !',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Matthias','https://www.airbnb.de/rooms/31289582/reviews','Mrz 2019'),
(976,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Pro:\n- sehr saubere und gepflegte Wohnung/ Ausstattung\n- schne Lage, gute Erreichbarkeit\n- super Blick vom Balkon\n\nContra:\n- Launische, unberechenbare Kommunikation\n- Folgende Situation fand ich mehr als unangebracht: ich war als offensichtlich Schwangere auf dem Weg aus der hier gemieteten Wohnung und sage auch noch, dass wir etwas durcheinander sind und auf dem Weg zum Arzt (ich bin zuvor gestrzt und gehe in meinem Urlaub nicht zum Spa zum Arzt). Anstatt das Sie besorgt/hilfsbereit waren, haben Sie in einem sehr unfreundlichen Ton gesagt, dass das nicht Ihr Problem sei und keine Entschuldigung dafr, dass wir die Balkontr offen gelassen haben (Heizkosten). Wie kann man nur so wenig Verstndnis/Mitgefhl haben, vor allem wenn wir uns dafr schon direkt entschuldigt haben und dir Tr sofort schlossen?\n\nZudem hielten Sie uns vor, dass wir die Vorhnge an den Fenstern geffnet haben (diese konnte man innerhalb von 3 Sekunden wieder schlieen, also keine komplizierte Konstruktion). Dies schien auch auf Nachfragen ein Grund zur cholerischen Aufregung zu sein. Sind Vorhnge nicht dazu da, geffnet zu werden?\n\n!!!Ich wnsche Ihnen alles Gute und hoffe, dass Sie NIE auf solche Menschen wie sich selbst treffen, wenn Sie in einer Notlage sind!!!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Jenny','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),
(977,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist mit Liebe zum Detail und sehr zweckmig eingerichtet und bietet alles, was man fr eine kleine Auszeit bentigt. Geschfte, Restaurants und Ausflugziele befinden sich in unmittelbarer Nhe. Gerne wieder.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Martina','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),
