(1081,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Klasse Unterkunft. Es war, wie es beschrieben wurde; nichts geschnt oder ausgelassen. Einfach eine tolle Wohnung zum Wohlfhlen. Die Lage ist klasse, mit Blick auf die Bergwelt, kurze fulufige Wege zum Bcker (brigens ein echter Super-Bcker), zu Restaurants, Metzger, kleiner Supermarkt und zur Bahnstation der Zugspitzbahn. In alle Richtungen ist man sofort auf den gut ausgeschilderten Wanderwegen. Und wenn man doch mal mit dem Auto fhrt, ist am Haus immer ein Parkplatz. Die Wohnung selbst ist voll ausgestattet, Geschirr und Besteck ist mehr als ausreichend und aus einem Wurf (keine gesammelten Generationen-Nachlsse), gemtliche Betten und Sofas. Im Vorfeld war die Kommunikation zu Peter schon schnell, sauber, przise, und das hat sich fortgesetzt. Fr die wenigen offenen Fragen, die vor Ort waren, kam immer prompt und klar eine Antwort und Hilfe. Kurzum: das war nicht unser letztes Mal dort :-)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Thomas','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),
