(1156,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is fantastic!! The pictures are great but the place is even cuter and more cozy in person! We were a group of 6 adults and 2 dogs and the space was just the right size! Everything was so clean and the beds were comfortable. The location is great, right in the heart of Grainau in walking distance from several restaurants but still having beautiful Mountain Views from the balconies. The cable car to Zugspitz is less than 10 minutes by car. Peter was an exceptional host! He was very quick to respond to all of my questions with very thorough, thought out answers and excellent suggestions. Everyone was very happy with our stay and we will definitely recommend this place to our friends!!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Monica','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2018'),
