(1165,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peters place was bright and clean and comfortable. It was well situated for our ski tripjust a short drive to Lermoos and the Zugspitze. We even drove to St. Anton on one day (about 90 min away). There was plenty of space for our group: 4 adults and 3 kids.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jessica','https://www.airbnb.de/rooms/19774742/reviews','Januar 2020'),
