(1173,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My family and I had the extreme pleasure of staying in Peters 3rd floor apartment. Once you arrive and take in all the rustic Bavarian charm and beauty of his home with sweeping views all around from each balcony of the Alps, you will know you have reached the most breathtaking spot on earth. It was very hard to leave this place as it felt as an instant home made with much love and thoughtful touches throughout. Every balcony faces a magnificent view. Spacious apartment with an upper loft, wooden beams and rooftop skylights, Bavarian charm and decor, along with Peters warm hospitality made this a dream vacation. If you have the pleasure of visiting Grainau, look no further! Peters Oberen Dorfplatz location will welcome you to an alpine home that will make lasting memories.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Maria','https://www.airbnb.de/rooms/19774742/reviews','September 2019'),
