(1179,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peters place in Grainau is excellent in every way. It is right next to the trails to the Zugspitze, near dozens of restaurants, and a very short walk to the train station. A small grocery store is a short walk away, and there a large supermarkets a short drive away. Peters house is spotlessly clean, very comfortable, and well suited to groups. I would highly recommend staying here.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'John','https://www.airbnb.de/rooms/19774742/reviews','Juli 2019'),
(1180,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a lovely apartment with beautiful views of the mountains on all sides. The location is great for exploring the local area - restaurants, the train station and the local pool are all in easy walking distance. Peter was quick with communication and helpful. The only downside was the significant construction work happening on the square directly outside the building. This caused a lot of early noise, affected the electricity supply one morning, and made comings and goings and parking rather more complicated. Hopefully this will be over soon for others!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Kristin','https://www.airbnb.de/rooms/19774742/reviews','Juli 2019'),
