(1560,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Last minute booking and Dita was very accommodating. The apartment is well stocked and we slept 4 comfortably (fit in couch folds down the size of about a king size bed). I would stay here again. Great little town and close to Garmish for skiing. Only complaints: The shower head is awesome, unfortunately at 6\'4\" it came to just below my shoulder. But great water pressure and plenty of hot water. The parking was across the street in the grocery store parking lot. Both issues were minor and should not deter most people from staying here.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Joe And Cristin','https://www.airbnb.de/rooms/22523800/reviews','Januar 2019'),
