(1567,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a wonderful place for travelers to stay during a trip to lovely Oberammergau. Dita is extremely courteous and helpful, offering us suggestions for hikes and other fun things to do while in town (try the Alpine Coaster!). The space itself is especially charming and cleanwe felt comfortable there at once. There is one bedroom with (I think) a Queen size bed, and a pull out sofa bed thats about the same size in the main room that also houses a sink, small stovetop, and fridge. The bathroom and shower room are very clean, and towels were provided. The shower is a bit low in height (Im 61 and had to crouch a bit to fit under the shower head) but this is honestly a minor inconvenience unless you are especially tall (I think anyone 58 or under can fit in it without issue). The location is primea 1min wall from the bus stop, several grocery stores and shops are right across the street, perhaps 5 or so min from the town center with restaurants and shops, and walkable to many trailheads. Truly I can not recommend this lodging (and Oberammergau) enough!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Harrison','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),
