(2168,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Lage in Hammersbach, nahe Hllentalklamm und Seilbahnen. Allerdings nicht an der Piste wie in der Anzeige beschrieben. Tolle Aussicht vom Balkon. Netter Kontakt zur Vermieterin, Schlsselbergabe reibungslos. Nahe der Zugspitzbahnhaltestelle. Super Ausgangspunkt fr Wanderungen.\nAusstattung im Wohnzimmer gut, Kche und Schlafzimmer sehr klein, fr 3-4 Erwachsene\neher nicht zu empfehlen. Kochen nicht gut mglich, da nur 2 Herdplatten, Kaffeemaschine nicht nutzbar.\nSchlafzimmer nichts fr Menschen mit Platzangst oder Grogewachsene. Bad ist okay.\nPreis-Leistungs-Verhltnis nicht angemessen, deutlich zu teuer fr die Ausstattung und Gre der Wohnung.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Christian','https://www.airbnb.de/rooms/21411333/reviews','Juli 2021'),
