(2184,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment is wonderful, the sofa bed was the most comfortable one we\'ve encountered. The location is perfect if you like hiking or cycling, and the main grocery stores are closer than they are to town. Great location.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Gustav','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),
(2185,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Romy provides a very cute and cozy apartment. The view from the balcony in the mornings is breathtaking. The ONLY very minor complaint was that the room the bed is in has a pitched ceiling so its a bit difficult to get in/out the bed or be in the room at all for anything other than sleeping. Other than that our stay was very enjoyable and Romy was a very sweet host.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ali','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),
(2186,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A beautiful, cozy apartment. Very comfortable for two or three people. The balcony has a superb view of the Zugspitze and the apartment contains everything you would need for a short or long stay. The communication was perfect and the host was very helpful. The apartment is in an amazing location for visiting the mountains and lakes with the train and bus just a couple of minutes walk away. We couldnt have asked for a better place to stay and very highly recommend the apartment.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ian','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),
