(2446,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Surprised my girlfriend and our newborn with a stay at the Fauske Birdbox, March 14-15. The weather was perfect for sunset, starlit night sky and beautiful sunrise. Couldnt be happier with the decision!\n\nCommunication with Torstein and check-in/out was excellent.\n\nPerfect to spice up a roadtrip/vacation or as a surprise gift for someone special :)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Aleksander','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),
(2447,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sure, it was beautiful and the location was great. There was access to small cabin with some amenities and a bathroom. Very photogenic.\n\nOur cabin was said on this page to have some source of heat, however we have now spent the night in a freezing cold \"Birdbox\". Of course we searched for ways to heat the place up, however the only oven we found was hidden under the bed behind some walls and obviously not meant for us to find or adjust. There were no higher settings on the oven either. This should obviously be clearly stated on their page on Airbnb as people do risk getting sick.\n\nThe birdbox was also filled with condensation and everything was completely wet, with water running down the windows that covered the walls.\n\nIkke verdt den stive prisen, med tanke p dugg, fukt og kulde som burde vre minimumsstandard. Veldig (Hidden by Airbnb) -vennlig da! Sikkert verdt det om vren/sommeren.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Erik','https://www.airbnb.ca/rooms/34692739/reviews','November 2020'),
