(2490,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The bird box is definitely unlike anywhere we\'ve stayed before!\n\nWe watched one of the best midnight sunsets of our lives against the mountains as we fell asleep. The view is incredible, even better than the pictures can show.\n\nBring some good hiking shoes, preferably water proof. It\'s a short hike to the box, only about 200 meters, but the path can be very muddy and the terrain uneven.\n\nIt may be a little rustic for some people\'s taste but I think that\'s obvious from the description and pictures. The view is definitely worth it though!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ray','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),
