(2492,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing place to stay. Beautiful view from the bird box no matter what the weather is like. Nice comfortable bed great experience will definitely stay again',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Martin','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),
(2493,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is truly outstanding. The pictures does not do this place justice. It is even better. We were a bit unprepared for the little walk up to the box as was raining a lot and the grass was really wet and damp. Torstein gave us the heads up so we could use the simple yet effective solution of plastic bags on feet. Really appreciated. Really highly recommendthis place. Stunning views and a different stay for a perfect memory with my husband.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nancy','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),
(2494,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a magical experience! I spent an evening and night watching the changing weather and the shifting of light, comfortly inside the birdbox, with a beautiful view of the mountains and fjord. And with cows and sheeps grazing in the green hillside just below the box. The interior was high quality, very comfortable! The toilet in the summerbarn located just nearby was a nice, clean and practical solution. The short hike up to the birdbox was easy, just long enough to give a hideaway-feeling. This is unique, life felt so uncomlicated here, and I highly recommend a stayover.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Liv-Anne','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),
