(2561,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Dette var en helt magisk opplevelse. Jeg og kona feiret Valentines day, og dette er noe vi aldri kommer til  glemme. Utsikten m vre en av verdens beste, og bde landskapet og himmelen viste seg p alle mter. Fra solnedgangen p ettermiddagen, til  sovne under stjernehimmelen, og til  vkne til ett fantastisk fargespekter over fjellene og utover fjorden. Absolutt verdt hvert eneste minutt. Alt var godt tilrettelagt. Birdboxen kunne til tider bli litt varm (til tross for 10-15 minus ute), men nr vi fikk taket p innstillingene p panelovnen, s gikk det bra. Alt var rent og fint. Det var lagt frem ved og utstyr til opptenning av blpannen, og det benyttet vi oss av under stjernehimmelen. Utrolig opplevelse  sitte ved blpannen under stjernehimmelen p kvelden. Toalettet var litt vanskelig  f til  virke skikkelig, trolig p grunn av kulden, og at pumpen ble frossen. Det var godt lagt til rette med primus til  varme vann til kaffe, vask eller andre ting. Eneste problemet vi hadde var at veien opp til parkeringsplassen var svrt bratt og glatt, s vi kom oss ikke helt opp. Men vi fikk hjelp av en nabo, og fikk parkere ved en fjs lenger ned i bakken. Alt i alt en uforglemmelig opplevelse.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Frank Willy','https://www.airbnb.ca/rooms/34692739/reviews','February 2021'),
