(2612,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk utsikt, skinnende rent, og kult konsept. Selve Birdbox\'en er veldig stilig, men den var mindre enn frst forventet. Det blir ogs veldig varmt der inne nr sola skinner. Vannet som sto p bordet var varmt, og vi mtte ha dren p gltt om natta. Det er ikke noe sted  oppbevare matvarer som er avhengig av kjlig temperatur. Det er bare ett hndkle. Og varm mat m kokes eller stekes p primusen i fjset. S ble litt skuffet nr vi hadde kjpt med oss melk, smr og egg til frokosten. Ellers var oppholdet greit',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Henrik','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),
