(2623,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','En fantastisk fin opplevelse! Veldig kult konsept! Vi har virkelig kost oss. Rent og fint. Helt greit toalett med en vask med spe og vann i sommerhuset. I sommerhuset var det og en primus, skjrebrett, kniv, kaffepulver, te, vann og to kaffe/te krus. Det er lys bde i sommerhus og birdbox, samt en lykt i begge bygg. I birdbox var det en vannkaraffel og to vinglass. Nydelig utsikt  bde sovne og vkne opp til!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jeanette','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),
