(2633,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','10 av 10 p unik overnatting! Dette m du se! Det er godt skiltet underveis til grden, og ca 5-7 minutters gange fra parkeringsplassen.\nVi var der i februar og fikk en liten gjrmete vei til birdbox men nr du kommer til toppen er turen verdt det. Den er liten og kompakt, men du har en herlig seng og en utsikt du ALDRI VIL GLEMME! Vann og stearinlys stod klart, samt utallige tepper for  holde oss varm. Vi hadde lest p forhnd at birdboxen kan opplevels kald s vi hadde gode klr, men det er nok tepper til  kle seg inn og bare kose seg!Verten svarte oss umiddelbart ved sprsml og var opptatt av at vi skulle ha det bra. Selv med en stormfull natt (som var litt kjedelig nr man m ut i det andre huset for  g p toalettet midt p natten) hvor vi hrte alle vindkast og tordenvr - var opplevelsen noe vi aldri ville vrt foruten. Selve stormen gjorde det bare spennende. I huset ved siden av har du toalett og mulighet til  lage kaffe.\nVi fikk en flott morgen dagen etter.  se Norge vkne til sol og lys om morgen er magisk! Og det fr du her!\nJeg tok med min mann p overraskelsestur hit, og den ble veldig godt imottatt.\nAnbefales p det sterkeste!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Anniken','https://www.airbnb.ca/rooms/34692739/reviews','February 2020'),
