(2938,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ganz in der Nhe des Bahnhofs ist das Haus schn warm - es verfgt ber die Annehmlichkeiten, die du bentigst (eine gut ausgestattete Kche, eine Waschmaschine usw.). Am wichtigsten ist, dass Elsa die netteste Gastgeberin ist, die ich je hatte, und sie kmmert sich wirklich um alle ihre Gste - sie kommuniziert und versucht ihr Bestes, wann immer mglich zu helfen. Bitte probier sie aus!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Samuel','https://www.airbnb.de/rooms/48268802/reviews','Dezember 2021'),
(2939,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa ist eine groartige Gastgeberin. Macht alles, was fr den Aufenthalt bentigt wird, wirklich einfach und unkompliziert. Sehr empfehlenswert!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Prathmesh','https://www.airbnb.de/rooms/48268802/reviews','Dezember 2021'),
