('cfc50930-c099-11ee-8141-2ff108203f6d',34,'John','Smith','John Smith','1-1934-1',NULL,NULL,NULL,NULL,'USD','This is the heart and soul of our community! We dont have the luxury of meeting you in person yet, so be as thoughtful and thorough as possible.',NULL,'2024-02-01 00:35:34','2024-02-27 19:50:00',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Vegan'),
